import { CSSProperties } from "react";

const getStyling = (): { rowContainer: CSSProperties } => {
  return {
    rowContainer: {
      display: "flex",
      flexDirection: "row",
      alignItems: "center",
      justifyContent: "center",
      height: 76,
    },
  };
};

export default getStyling;
